    "2016-07-27T22:42:59.634402",nt"name": "arrowwood-national-wildlife-refuge-narrative-report-september-october-november-decembe-195-3a13b",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Arrowwood NWR
    (including Chase Lake NWR and District VI Easement Refuges) outlines Refuge accomplishments
    from September through December of 1958. The report begins by summarizing the weather
    conditions, habitat conditions, water conditions, and food and cover during this
    period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, mammals, raptors, and fish- is also covered. The
    Refuge development and maintenance section discusses physical developments, plantings,
    collections and receipts, vegetation control, and wildfires. Resource management
    is outlined; topics include grazing, haying, and fur harvesting. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, and violations. Items of interest and N-R forms are attached.",nt"license_title":
